    const countUpRefThree = useRef();
    const countUpRefFour = useRef();
    const countUpRefFive = useRef();
    const countUpRefSix = useRef();
    const countUpRefSeven = useRef();
    const countUpRefEight = useRef();
    const countUpRefNine = useRef();
  
