    const { start: startCountUpTwo } = useCountUp({ ref: countUpRefTwo, end: 25, duration: 2, startOnMount: false });
    const { start: startCountUpThree } = useCountUp({ ref: countUpRefThree, end: 25, duration: 2, startOnMount: false });
